use crate::sampler::Sampler;

struct Matrices {
    num_dimensions: u64,
    size: u64,
    matrices: Vec<u64>,
}

pub struct Sobol {
    m: Matrices,
}

impl Sampler for Sobol {
    fn init() -> Self {
        let m : Matrices = Matrices::default();
        Sobol {
            m
        }

    }

    // Compute one component of the Sobol'-sequence, where the component
    // corresponds to the dimension parameter, and the index specifies
    // the point inside the sequence. The scramble parameter can be used
    // to permute elementary intervals, and might be chosen randomly to
    // generate a randomized QMC sequence. Only the Matrices::size least
    // significant bits of the scramble value are used.
    fn sample_a_point(&mut self, index: u64, dimension: u64, offset: f64) -> f64 {
        assert!(dimension < self.m.num_dimensions);
        let scramble = offset;
        let mut result: u64 = (scramble as u64) & !(-(1 << self.m.size) as u64);

        let mut i: usize = (dimension * self.m.size) as usize;
        let mut index_mut = index;
        while index_mut > 0 {
            if (index_mut & 1) > 0 {
                result ^= *self.m.matrices.get(i).unwrap();
            }
            index_mut >>= 1;
            i += 1;
        }
        (result as f64) * (1.0 / (1 << self.m.size) as f64)
    }
}

